import classes from "./contact.module.css";
import Card from "../components/Card";
import InfoBox from "../components/contact/InfoBox";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { FaUserAlt } from "react-icons/fa";
import { FaMapMarkerAlt } from "react-icons/fa";

function Contact(){
    return (
        <Card>
            <h2 className={classes.title}>Contact me</h2>
            <h2>I'd love to hear from you</h2>
            <p>Please, feel free to use the info below to contact me. Let's work together !</p>
            <div className={classes.container}>
                <div className={classes.columnLeft}>
                    <div className={classes.infoBox}>
                        <InfoBox icon="FaUserAlt" head="Name" subtitle="Andreea Farago"></InfoBox>
                        <InfoBox icon="FaMapMarkerAlt" head="Address" subtitle="Timis, Romania"></InfoBox>
                    </div>  
                </div>
                <div class="column-right"><img src="../images/contact.png" /></div>
            </div>     
        </Card>
    );
}

export default Contact;
